import React, { useEffect,useState } from "react";
import {
  View,
  ImageBackground,
  StyleSheet,
  Dimensions,
  TouchableOpacity,
  Image
} from "react-native";
import { FontAwesome } from '@expo/vector-icons';

const logo = require("../../../assets/images/earn.png");


const { height, width } = Dimensions.get("screen");

export default (props) => {
      return  (
      <View style={style.container}>
        <ImageBackground
          style={style.background}
          source={logo}
        />

      </View>
    );
  }


const style = StyleSheet.create({
  container: {
    flex: 1,
    height,
    width
  },
  background: {
    height: '100%',
    width: '100%',
    zIndex:1,
    position: 'relative'
  },
  btn:{
    height:30,
    width:60,
    borderColor: '#fff',
    zIndex:2,
    position:'absolute',
    bottom: '40px',

  }

});
